import React from 'react';
import { Card, CardBody, CardTitle, CardSubtitle, Button } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLink } from '@fortawesome/free-solid-svg-icons';

export default class CopyLink extends React.Component {
	constructor() {
		super();
	}

	render() {
		return (
			<div style={{ display: 'flex', justifyContent: 'space-end', alignItems: 'flex-end' }}>
				<span>
					<FontAwesomeIcon size="1x" style={{ color: 'grey', marginRight: '20px' }} icon={faLink} /> coucou
				</span>
				<Button style={{ width: '50px', height: '25px' }} outline color="secondary">
					COPIER
				</Button>
			</div>
		);
	}
}
